export const login = ({ username, password }) => {
    return new Promise((resolve, reject) => {
        setTimeout(() => {
            if (Math.random() > 0.5) {
                resolve({
                    username: username?.toUpperCase() ?? 'BILLY'
                });
            } else {
                throw(new Error('Impossible!'));
            }
        }, 5000);
    });
};
